libonline_mobile = {
	
	// path of the jplayer flashpart
	swfpath: "./js/",
	// variable for iscroll
	iscroll_var: false,
	// ajax-path
	ajaxpath:"./ajax.php",
	// data holders
	data: {
		update_interval: false,
		buffer_pct : false,
		act_path: "/",
		sid:false,
		oldbg:false,
		tto:false
	},
	
	/***************************
	* this function is called after dom is ready
	***************************/
	init: function(){
		
		// init the iscroll layout
		libonline_mobile.iscroll_var = new iScroll('wrapper', {
			useTransform: false,
			onBeforeScrollStart: function (e) {
				var target = e.target;
				while (target.nodeType != 1) target = target.parentNode;
				if (target.tagName != 'SELECT' && target.tagName != 'INPUT' && target.tagName != 'TEXTAREA')
					e.preventDefault();
			}
		});
		document.addEventListener('touchmove', function (e) { e.preventDefault(); }, false);
		
		// init subparts
		this.player.init();
		this.browser.init();
		
		// menu actions
		$("#btn_playlist").click(function(){
			libonline_mobile.playlist.show();
		});
		$("#btn_browser").click(function(){
			libonline_mobile.browser.show();
		});
		$("#btn_search").click(function(){
			libonline_mobile.search.show();
		});
		$("#btn_more").click(function(){
			return;
		});
		
		// searching
		$("#search_btn_go").click(function(){
			libonline_mobile.search.go();
		});
		$("#frm_search").submit(function(){
			libonline_mobile.search.go();
			return false;
		});
		
		// player actions
		$("#btn_b").click(function(){ libonline_mobile.playlist.play_prev(); });
		$("#btn_f").click(function(){ libonline_mobile.playlist.play_next(); });
		
		// media path
		libonline_mobile.mp_path=dirname(location.href)+"/m/file.php?f=";
		
		// dev thingy
		//libonline_mobile.playlist.show();
	},


	/***************************
	* this function is called when exit page
	***************************/
	exit: function(){
		// nothing yet
	},


	/*******************************
	 * class for player
	 *******************************/
	player: {
	
		//
		// init the player
		//
		init: function(){
			$("#jp").jPlayer({
				preload:"auto",
				supplied: "mp3",
				solution: "html, flash",
				ready: function () {
					var jPlayerElement = $(this);
					jPlayerElement.bind($.jPlayer.event.progress,function(event) {
						jPlayerElement.jPlayer( "play" );
					});
				},
				ended: function() { 
					var obj=$('#playlist li.act').next();
					$("#playlist > li").removeClass('act');
					if (obj.length==0){
						libonline_mobile.player.stop();
					} else {
						libonline_mobile.playlist.play_obj(obj);
					}
				},
				cssSelectorAncestor: "", 
				cssSelector: {
				  play: "#btn_p",
				  pause: "#btn_pp",
				  stop: "#btn_s",
				  seekBar: "#player_bar_load",
				  playBar: "#player_bar_play",
				}
			});
		},

		//
		// play a url
		//
		play_file: function(url){
			$("#jp").jPlayer("clearMedia").jPlayer("setMedia", { mp3 : url } )
		},

		//
		// update player-text
		//
		set_info: function(data){
			$('#song_label').html("<b>"+data.title+"</b> - "+data.artist+" - <i>"+data.album+"</i>");
		},

		//
		// stop playback
		//
		stop: function(){
			$("#jp").jPlayer( "stop" ).jPlayer( "clearMedia" );
		},


	},


	/*******************************
	 * class everything with playlist-stuff
	 *******************************/
	playlist: {

		//
		// show the playlist
		//
		show: function(){
			libonline_mobile.playlist.add_handlers();
			libonline_mobile.show_tab("#playlist_t","#btn_playlist");
			libonline_mobile.iscroll_var.scrollToElement('li.active');
		},

		//
		// add a file to playlist
		//
		add: function(file){
			var obj=$('<li class="item pl"><div class="tx">'+basename(file)+'</div><div class="action"></li>').
				data("p",file),
				act=$("#playlist li.act");

			$("#playlist").append(obj);
			libonline_mobile.playlist.add_handlers();
			if (act.length==0){
				libonline_mobile.playlist.play_obj($("#playlist > li:last"));
			}
		},

		//
		// add playlist-handlers
		//
		add_handlers: function(){
			$("#playlist > li > div.action").click(function(){
				$(this).parent().remove();
			});
			$("#playlist > li > div.tx").click(function(){
				var obj=$(this).parent();
				libonline_mobile.playlist.play_obj(obj);
			});
		},

		//
		// play an object
		//
		play_obj: function(obj){
			if (obj.length==0){ return ; }
			var path=obj.data("p"),
				base=Base64.encode(path),
				url=libonline_mobile.mp_path+base;
			$.ajax({
				type: "POST",
				url: libonline_mobile.ajaxpath,
				data: {"mod":"tags","base":base},
				dataType:"json",
				success: function(data) {
					libonline_mobile.player.set_info(data);
					$("#playlist > li").removeClass('act');
					obj.addClass("act");
					libonline_mobile.player.play_file(url);
				}
			});
		},

		//
		// play next song
		//
		play_next: function(){
			libonline_mobile.playlist.play_obj($('#playlist li.act').next());
		},

		//
		// play previous song
		//
		play_prev: function(){
			libonline_mobile.playlist.play_obj($('#playlist li.act').prev());
		},


	},
	
	/*******************************
	 * file browser
	 *******************************/
	browser: {
		// holder-div
		holder_div: "#browser",

		//
		// show browser
		//
		show: function(){
			libonline_mobile.show_tab("#browser","#btn_browser");
		},

		//
		// init the browser
		// 
		init: function(){
			$.ajax({
				type: "POST",
				url: libonline_mobile.ajaxpath,
				data: {},
				dataType:"json",
				success: function(data) {
					libonline_mobile.browser.update_data(data);
				}
			});
		},

		//
		// goto an specified path
		//
		goto: function(path){
			var base=Base64.encode(path);
			$.ajax({
				type: "POST",
				url: libonline_mobile.ajaxpath,
				dataType:"json",
				data: {"p":base},
				success: function(data) {
					libonline_mobile.browser.update_data(data);
				}
			});
		},

		//
		// update browser data
		//
		update_data: function(data,bn,handler,up){
			if (typeof bn == 'undefined' ) bn = false;
			if (typeof handler == 'undefined' ) handler = true;
			if (typeof up == 'undefined' ) up = true;
			$("#filelist").html('');
			for (i in data.folders){
				if (i==0 && data.path!="/" && data.path!="" && up){ var txt=".."; }
				else { var txt=basename(data.folders[i]); }
				var obj=$("<li class='item dir'>"+txt+"</li>").
					data("p",data.folders[i]);
				$("#filelist").append(obj);
			}
			for (i in data.files){
				if (bn) { txt=basename(data.files[i]); }
				else { txt=(data.files[i]); }
				var obj=$("<li class='item file'>"+txt+"</li>").
					data("p",data.files[i]);
				$("#filelist").append(obj);
			}
			libonline_mobile.iscroll_var.refresh();
			libonline_mobile.iscroll_var.scrollToElement('li:nth-child(1)');
			if (handler){
				libonline_mobile.browser.add_handlers();
			}
		},

		//
		// update/add handlers
		//
		add_handlers: function(){
			// handler for clicking on a directory
			$("#filelist > li.dir").click(function(){
				$(this).addClass("wait");
				$(this).removeClass("dir");
				var new_path=$(this).data("p"),
					base=Base64.encode(new_path);
				$.ajax({
					type: "POST",
					url: libonline_mobile.ajaxpath,
					data: {"p":base },
					dataType:"json",
					success: function(data) {
						libonline_mobile.data.act_path=new_path;
						libonline_mobile.browser.update_data(data);
					}
				});
			});
			// handler for clicking on a audio-file
			$("#filelist > li.file").click(function(){
				$(this).animate({ backgroundColor: "#86BCF9" },300, function(){
					$(this).animate({ backgroundColor: "#ffffff" },200);
				});
				var file=$(this).text(),
					path=libonline_mobile.data.act_path+"/"+file;
				libonline_mobile.playlist.add(path);
			});
		},


	},

	/***************************
	 * searching
	 ***************************/
	search: {

		//
		// show the search-tab
		//
		show: function(){
			libonline_mobile.show_tab("#search","#btn_search");
		},

		//
		// do search
		//
		go: function(){
			$("#search_result").hide();
			$("#search_progress").show();
			$.ajax({
					type: "POST",
					url: libonline_mobile.ajaxpath,
					data: {"mod":"search","q":$("#inp_search").val() },
					dataType:"json",
					success: function(data) {
						libonline_mobile.search.update_data(data);
						libonline_mobile.search.set_handlers();
					}
			});
			return false;
		},

		//
		// update search data
		//
		update_data: function(data){
			var oo=$("#search_result");
			oo.html("");
			for (i in data.folders){
				var obj=$("<li class='item dir'>"+data.folders_mark[i]+"</li>").
					data("p",data.folders[i]);
				oo.append(obj);
			}
			for (i in data.files){
				var obj=$("<li class='item file'>"+data.files_mark[i]+"</li>").
					data("p",data.files[i]);
				oo.append(obj);
			}
			$("#search_progress").hide();
			$("#search_result").show();
			libonline_mobile.iscroll_var.refresh();
		},

		//
		// set handlers
		//
		set_handlers: function(){
			// handler for clicking on a folder
			$("#search_result > li.dir").click(function(){
				libonline_mobile.browser.goto($(this).data("p"));
				libonline_mobile.browser.show();
			});
			// handler for clicking on a audio-file
			$("#search_result > li.file").click(function(){
				$(this).animate({ backgroundColor: "#86BCF9" },300, function(){
					$(this).animate({ backgroundColor: "#ffffff" },200);
				});
				libonline_mobile.playlist.add($(this).data("p"));
			});
		}


	},

	//
	// show_hide tab
	//
	show_tab: function(area_sel,btn_sel){
		var o=$(area_sel);
		if (!o.is(":visible")){
			$("#scroller > div").hide();
			o.show();
			$("#footer > div.controls > div").removeClass("act");
			$(btn_sel).addClass("act");
		}
		libonline_mobile.iscroll_var.refresh();
	}	
}


